const main = () => {
  return (
    <div className="h-400 bg-white ">
      <div className="flex justify-center">
        <h1 className="text-4xl font-bold">EDUCATION</h1>
      </div>

      <div className="flex flex-col  ">
        <div className="bg-red-400  m-10 border-2 rounded-xl p-8 h-80 md:w-1/3">Xth Qualification
        <ul className="">
        <li>j</li>
        <li>s</li>
        <li>sa</li>
        </ul></div>
        <div className="bg-yellow-400 m-10 border-2 rounded-xl p-8  h-80 md:w-1/3">XIIth Qualification</div>
        <div className="bg-blue-400 m-10 border-2 roundedrounded-xl p-8 h-80 md:w-1/3">Graduation</div>
      </div>
    </div>
  );
};

export default main;
